import React, { useState, useEffect } from "react";
import { makeStyles } from "@material-ui/styles";

import { Divider } from "@material-ui/core";

const useStyles = makeStyles((theme) => ({
  root: {
    padding: theme.spacing(3),
  },
  content: {
    marginTop: theme.spacing(2),
  },
  pagination: {
    marginTop: theme.spacing(3),
    display: "flex",
    alignItems: "center",
    justifyContent: "flex-end",
  },
  destinataire: {
    color: theme.palette.primary.main,
  },
  expediteur: {
    textAlign: "right",
  },
  page: {
    backgroundColor: "#fff000",
    width: "210mm",
    height: "297mm",
    padding: 30,
  },
}));

const Template = () => {
  const classes = useStyles();

  return (
    <div id="divToPrint" className={classes.page}>
      <div class="divToPrint ">
        <div className={classes.pageBis}>
          <div className={classes.destinataire}>
            <p>Monsieur Macron</p>
            <p>14 rue de Massenet</p>
            <p>75016 Paris</p>
          </div>
          <div className={classes.expediteur}>
            <p>Locataire</p>
            <p>Adresse</p>
            <p>Ville</p>
          </div>

          <div>
            <h1>QUITTANCE DE LOYER</h1>
            <Divider className={classes.divider} />
          </div>
          <div>
            <p>Mademoiselle,</p>
            <Divider className={classes.divider} />
            <p>
              Je vous remercie d'avoir effectué le versement du montant de votre
              loyer pour la periode du x au x MONTH pour les locaaux que vous
              occupez sis à VILLES, ADRESSE, et dont le detail est cidessous:
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Template;
